sympy.sympy.core.decorators._func:
@wraps(func)
def _func(self, other):
    # XXX: The check for _op_priority here should be removed. It is
    # needed to stop mutable matrices from being sympified to
    # immutable matrices which breaks things in quantum...
    if not hasattr(other, '_op_priority'):
        try:
            other = sympify(other, strict=True)
        except SympifyError:
            return retval
    if not isinstance(other, expectedcls):
        return retval
    return func(self, other)

sympy.sympy.core.relational.__new__:
def __new__(cls, lhs, rhs, **options) -> Equality | BooleanFalse | BooleanTrue: # type: ignore
    evaluate = options.pop('evaluate', global_parameters.evaluate)
    lhs = _sympify(lhs)
    rhs = _sympify(rhs)
    if evaluate:
        val = is_eq(lhs, rhs)
        if val is None:
            return cls(lhs, rhs, evaluate=False)
        else:
            return _sympify(val)

    return Relational.__new__(cls, lhs, rhs)

sympy.sympy.logic.boolalg.__eq__:
def __eq__(self, other):
    if other is True:
        return False
    if other is False:
        return True
    return super().__eq__(other)

sympy.sympy.matrices.expressions.matexpr:
@classmethod
def _check_dim(cls, dim):
    """Helper function to check invalid matrix dimensions"""
    ok = not dim.is_Float and check_assumptions(
        dim, integer=True, nonnegative=True)
    if ok is False:
        raise ValueError(
            "The dimension specification {} should be "
            "a nonnegative integer.".format(dim))

def __new__(cls, *args, **kwargs):
    args = map(_sympify, args)
    return Basic.__new__(cls, *args, **kwargs)

sympy.sympy.matrices.expressions.special:
def __new__(cls, n):
    n = _sympify(n)
    cls._check_dim(n)

    return super().__new__(cls, n)
